import setApi from "../api";

export function getResellers(cb) {
  setApi()
    .get("/reseller")
    .then(response => {
      cb(null, response.data);
    })
    .catch(err => {
      cb(err);
    });
}

export function deleteReseller(id, cb) {
  setApi()
    .delete(`/reseller/${id}`)
    .then(response => {
      cb(null, response.data);
    })
    .catch(err => {
      cb(err.response ? err.response.data : err.toString());
    });
}

export function editReseller(id, data, cb) {
  setApi()
    .put(`/reseller/${id}`, data)
    .then(response => {
      cb(null, response.data);
    })
    .catch(err => {
      cb(err.response ? err.response.data : err.toString());
    });
}
